SELECT query_discord_id AS "query_discord_id!", "member".id as "id?", "member".meetup_id, "member".discord_nick
        FROM UNNEST($1::bigint[]) AS query_discord_id
        LEFT OUTER JOIN "member" ON query_discord_id = "member".discord_id;

